CREATE DEFINER=`root`@`localhost` PROCEDURE `ActualizarCorte` (IN `idEmpleado` INT)  BEGIN
    set @Corte = '';
    select max(idCorte) into @Corte from corte;
    update venta set idCorte = @Corte, Corte = 1 where pagado = 1 and corte = 0 and venta.idEmpleado = idEmpleado;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `DetalleCliente` (IN `idCliente` INT, IN `tipo` VARCHAR(20))  BEGIN
    if strcmp('credito', tipo) = 0 then
        select empleado.Nombre, idVenta, NumeroTelefono, Monto, Usd, Mxn, fecha, Observaciones
        from venta
                 inner join empleado on venta.idEmpleado = empleado.idEmpleado
        where venta.idCliente = idCliente and Pagado = 0 and NombreServicio = 'Recarga de saldo'
        order by fecha desc;
    else
        select empleado.Nombre, idVenta, NumeroTelefono, Monto, Usd, Mxn, fecha, Observaciones
        from venta
                 inner join empleado on venta.idEmpleado = empleado.idEmpleado
        where venta.idCliente = idCliente and Pagado = 1 and NombreServicio = 'Recarga de saldo';
    end if;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `DetalleCorte` (IN `idEmpleado` INT)  BEGIN
    select empleado.Nombre,
           COALESCE((select sum(Monto) from venta where venta.idEmpleado = idEmpleado and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'SaldoVendido',
           COALESCE((select sum(Usd) from venta where venta.idEmpleado = idEmpleado and NombreServicio = 'Recarga de saldo' and Pagado = 1 and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'UsdSaldo',
           COALESCE((select sum(Mxn) from venta where venta.idEmpleado = idEmpleado and NombreServicio = 'Recarga de saldo' and Pagado = 1 and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'MxnSaldo',
           COALESCE((select sum(Usd) from venta where venta.idEmpleado = idEmpleado and NombreServicio != 'Recarga de saldo' and Pagado = 1 and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'DolaresServicios',
           COALESCE((select sum(Mxn) from venta where venta.idEmpleado = idEmpleado and NombreServicio != 'Recarga de saldo' and Pagado = 1 and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'PesosServicios',
           COALESCE((select sum(Usd) from venta where venta.idEmpleado = idEmpleado and Pagado = 1 and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'Dolares',
           COALESCE((select sum(Mxn) from venta where venta.idEmpleado = idEmpleado and Pagado = 1 and Corte = 0 and fecha between (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) and CURRENT_TIMESTAMP()),0) As 'Mxn',
           COALESCE((select sum(Usd) from venta where venta.idEmpleado = idEmpleado and Pagado = 0 and NombreServicio = 'Recarga de saldo'),0) As 'CreditoRecargasUsd',
           COALESCE((select sum(Mxn) from venta where venta.idEmpleado = idEmpleado and Pagado = 0 and NombreServicio = 'Recarga de saldo'),0) As 'CreditoRecargasMxn',
           COALESCE((select sum(Usd) from venta where venta.idEmpleado = idEmpleado and Pagado = 0 and NombreServicio != 'Recarga de saldo'),0) As 'CreditoServiciosUsd',
           COALESCE((select sum(Mxn) from venta where venta.idEmpleado = idEmpleado and Pagado = 0 and NombreServicio != 'Recarga de saldo'),0) As 'CreditoServiciosMxn',
           COALESCE((select sum(Usd) from venta where venta.idEmpleado = idEmpleado and Pagado = 0),0) As 'CreditoUsd',
           COALESCE((select sum(Mxn) from venta where venta.idEmpleado = idEmpleado and Pagado = 0),0) As 'CreditoMxn',
           (select Fecha from venta where Corte = 0 and venta.idEmpleado = idEmpleado GROUP by Fecha asc limit 1) As 'Desde',
           (CURRENT_TIMESTAMP) As 'Hoy'
    from venta inner join empleado on empleado.idEmpleado = venta.idEmpleado where venta.idEmpleado = idEmpleado limit 1;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `InfoNumero` (IN `Telefono` VARCHAR(11))  BEGIN
    select e.Nombre As 'Empleado', c.Nombre As 'Cliente', NumeroTelefono, Monto, Usd, Mxn, fecha
    from venta
             inner join empleado e on venta.idEmpleado = e.idEmpleado
             inner join cliente c on venta.idCliente = c.idCliente
    where NumeroTelefono = Telefono
    order by fecha desc limit 1;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertarCorte` (IN `idEmpleado` INT, IN `Usd` FLOAT, IN `Mxn` FLOAT)  BEGIN
    set @fecha = '';
    select fecha into @fecha from venta where corte = 0 and pagado = 1 and venta.idEmpleado = idEmpleado order by fecha asc limit 1;
    values (idEmpleado, cast(@fecha As DATE ),now(), Usd, Mxn);
END$$

