                   if(venta.Corte = 1, 'Si', 'No') As 'Corte',fecha
            from venta
                     inner join empleado on venta.idEmpleado = empleado.idEmpleado
                     inner join cliente on venta.idCliente = cliente.idCliente
            where NombreServicio = 'Recarga de saldo' and venta.Pagado = Pagado and fecha between desde and hasta
