            select idVenta, empleado.Nombre As 'Vendedor', cliente.Nombre As 'Cliente', NumeroTelefono, Operadora, Monto,
                   if(Usd = 0, concat(Mxn,' Mxn'), concat(Usd,' Usd')) As 'Venta', Utilidad, if(Verificada = 0, 'Si', 'No') As 'Verificada', if(venta.Pagado = 1, 'Si', 'No') As 'Pagado',
                   if(venta.Corte = 1, 'Si', 'No') As 'Corte', fecha
            from venta
